// src/components/Header.js
import React from "react";
import "./Header.css";

function Header() {
    return (
        <header className="gnav-header">

            <div className="gnav-containerLift">
                {/* Logo */}
                <div className="logo">
                    <img
                        src="/SESBridge.png"
                        alt="SES Bridge"
                    />
                </div>
                <span>SESで業界活力を</span>

                {/* Navigation Links */}
                <nav className="gnav-links">
                    <a href="#home">ホーム</a>
                    <a href="#reviews">企業クチコミ</a>
                    <a href="#salaries">給与調査</a>
                </nav>
</div>
                {/* Search and Actions */}
                <div className="gnav-actions2">
                    <input
                        type="text"
                        placeholder="職種、キーワード、会社名"
                        className="search-input"
                    />
                    <button className="search-button">求人検索</button>
                </div>
        </header>
    );
}

export default Header;
